def get_mpl_colormap(name, alpha=1.0):
    """Retrieve matplotlib colormap
    """

    maps = {
        'seismic': _seismic_data,
    }

    if name in maps.keys():
        cmap = {}
        for x in maps[name]:
            cmap[x[0]] = x[1] + [alpha]
        return cmap
    else:
        print('Warning: Could not find provided colormap -- ' + str(name))
